import React from "react";
import {RatingIcon ,Money} from "../../utils/Icon";
import {productCards} from "../../utils/Constant"

const Image = (props) => {
    const src=props.src;
    const text=props.text;
  return (
    <div className="h-full w-full ring-1">
      <div className="inline-flex flex-col h-auto w-auto">
        <img className="" src={src} alt=""></img>
        <span>{text}</span>
        <div>{RatingIcon}</div>
        <div>{Money}</div>

      </div>
    </div>
  );
};

export default Image;
